import { Box, Button, Container, Grid, Hidden, TextField } from "@material-ui/core";
import React from "react";
import { useStyles } from "./BodyStyle";
import image from "../../images/commentPic.jpg";
import { RenderSectionHeading, CardMedia } from "../common/Common";

//import ScrollAnimation from 'react-animate-on-scroll';

export default function Comment() {
  const classes = useStyles();

  return (
    <Box className={classes.section3} id="Comments">
      {/* <ScrollAnimation animateIn='fadeIn'> */}
      <Container>
        <Grid container spacing={1}>
          <Grid item sm={5}>
            <Box component={Hidden} xsDown>
              <img
                src={image}
                alt=" about us"
                className={classes.responsiveImg}
              />
            </Box>
          </Grid>
          <Grid item xs={12} sm={7}>
            {RenderSectionHeading({
              smallText: "Make a Comment!",
              heading: "Comment Section has been designed for you..",
              description: "We are always open for your feedbacks! ",
            })}
                      <br />
                      <form>
                          <Grid className={classes.CommentForm} container 
                  direction='row'
                  justify='center'
                  alignItems='center'>
                          <Grid item xs={12} sm={10}>
                              <TextField  margin="normal" fullWidth id="outlined-basic" label="Outlined" variant="outlined" />
                              <TextField  margin="normal" fullWidth id="outlined-basic" label="Mail" variant="outlined" />
                                  <TextField
                                      margin="normal"
          id="outlined-multiline-static"
          label="Multiline"
          multiline
          rows={4}
                                      defaultValue="Leave a Comment!"
                                      fullWidth
        />
                              <Button fullWidth className={classes.submitBtn}>Submit</Button>

              </Grid>
            </Grid>
            </form>
          </Grid>
        </Grid>
      </Container>
      {/* </ScrollAnimation> */}
    </Box>
  );
}
